import React from "react";

function EditForm(props)
{
	let ccomps = props.choices.map((c)=>{
		return (
			<div className="voteRow" key={ c.id }>
				<span className="choiceText">c.choice_text</span>
				<button className="choiceVote">+</button>
				<button className="choiceDelete">delete</button>
				<span className="choiceVotes">c.votes</span>
			</div>
		);
	});

	return (
		<fieldset>
			<legend><h1>Votes for "{ props.question.question_text }"</h1></legend>
			<div className="voteContainer">
				{ ccomps }
			</div>
		</fieldset>
	);
}

export default EditForm;
